DECLARE @TEMP TABLE(BF_SSN VARCHAR(9),WF_ENR_STA_RPC_SEQ INT,WF_CRT_DTS_WKES VARCHAR(50),LN_SEQ INT,WC_ENR_STA_RPC_MSG VARCHAR(5),WX_ENR_STA_RPC_DTL VARCHAR(MAX),LN_ATY_SEQ INT)

SELECT DISTINCT
	T.*,
	LN10.LN_SEQ,
	CASE WHEN LN10.LC_STA_LON10 ='P' THEN 1 ELSE 0 END AS DCR
FROM
	@TEMP T
	INNER JOIN UDW..LN10_LON LN10
		ON LN10.BF_SSN = T.BF_SSN

